import React from 'react';
import classes from './header.module.css';

const cityBox = (props) => {
    return (
        <div className={classes.header}>
            <div className={classes.city}>
                <h2>Current City: Houston</h2>
            </div>
            <div className={classes.searchBox}>
                <p>Search</p>
                <input></input>
            </div>
        </div>
    );
};

export default cityBox;
